import React from "react";

import Helmet from "../components/Helmet";
import CategoryCard from '../components/CategoryCard'

function Category() {
  return
  <div>
    <Helmet title="Chủ đề">Category!!!</Helmet>;
    <div><CategoryCard
      img
    /></div>
    
  </div>;
}

export default Category;
